import { Link, Spacer } from '@chakra-ui/react';
import Logo from './images/netflix.png'
import {BiBell,BiSearch} from 'react-icons/bi'
import {GoPersonFill} from 'react-icons/go'

function App() {
  const containerStyle = {
    backgroundColor: 'slate',
  };
  return (
    <div className='App' style={containerStyle}>
    <div className="flex items-center">
        <img src={Logo} className="w-44 flex ml-5" alt=''/>
        <div className="flex space-x-6 pl-5">
          <Link>Home</Link>
          <Link>TV Shows</Link>
          <Link>Movies</Link>
          <Link>New & Popular</Link>
          <Link>My List</Link>
          <Link>Browse By Language</Link>
        </div>
        <Spacer/>
        <div className='mr-5 flex space-x-4'>
          <BiSearch size={24}/>
          <BiBell size={24}/>
          <GoPersonFill size={24}/>
        </div>
    </div>
    </div>
  );
}

export default App;
